import React from 'react'

function UserProfile({history}) {
    const userStyle = {
        width: "50%",
        height: "",
        border: "1px solid #eee",
        overflow: "hidden",
        padding: "10px",
        boxShadow: "2px 8px 20px #ddd",
        margin: "10px auto",
        transition: "0.5 linear"
    }
    let user = JSON.stringify(history.location.state.values.name)

    user = user.replace(/['"]+/g, '');
    console.log(user);

    return (
        <div style={userStyle}>
            Вы вошли как {user}
        </div>
    )
}

export default UserProfile
